import logo from './logo.svg';
import './App.css';
import Student from './Student';

const students = [
  {
    id: 2187434,
    name: 'Маша',
    tasks: 13
  }, 
  {
    id: 218998774,
    name: 'Паша',
    tasks: 13
  }
]

function App() {
  return (
    <div>
      {students.map(student => <Student {...student} key = {student.id}></Student>)}
    </div>
  );
}

export default App;
